import React from "react";
import { connect } from "react-redux";

import PostPreview from "../../components/PostPreview";

import { PostPreviewType } from "./types";

import { Section } from "./styledComponents";

const PostsList = ({ data, error }) =>
  error ? (
    <p>ERROR</p>
  ) : (
    <Section>
      {data.map(({ title, body, id }: PostPreviewType) => (
        <PostPreview key={id} title={title} body={body} id={id} />
      ))}
    </Section>
  );

export default connect((state) => state.postsListReducer)(PostsList);
